import React from 'react'

/*

* Adding list of people(from SurveySparrow ) among my shopify Customers -> Shopify API - AddCustomer.js
* After adding a customer, deleting their response -> SurveySparrow API - AddCustomer.js

*/

function AddCustomer() {
  return (
    <div>
      <Button primary>Add Customer</Button>
    </div>
  )
}

export default AddCustomer
